import React, { useState } from 'react';

import CustomButton from '../../components/custom-button/custom-button.component';

import './homepage.styles.scss'

const HomePage = () => {

    const [register, setRegister] = useState('Register');
    const [signin, setSignin] = useState('Sign in');

    return (
        <div className="background">
        <div className="container">
            <div className="row content">
                <div className="col"></div>
                <div className="col-8">
                    <h1 className="greeting">Welcome to GroceryUs</h1>
                </div>
                <div className="col"></div>
            </div>
            <div className="row mt-5">
                <div className="col"></div>
                <div className="col-sm-3 col-md-3 mt-1 buttons">
                    <CustomButton 
                        onMouseEnter={() => setRegister('Join us!')} 
                        onMouseLeave={() => setRegister('Register')}
                        isRegister
                    >
                        {register}
                    </CustomButton>
                    </div>
                    <div className="col-sm-3 col-md-3 mt-1 buttons">
                    <CustomButton 
                        onMouseEnter={() => setSignin('Welcome back!')} 
                        onMouseLeave={() => setSignin('Sign in')} 
                        isSignIn
                    >
                        {signin}
                    </CustomButton>
                </div>
                <div className="col"></div>
            </div>
        </div>
    </div>
    )
}

export default HomePage;
